quantityCompleted.onChange:
// Assuming rowData and workOrderQuantity are available
if (rowData.quantityCompleted + rowData.scrapQuantity >= rowData.quantityRequired) {
  // Update the record to set completed to true
  $dgSetRow('workOrderOperations', rowData.rowKey, {
    completed: true
  });
} else {
  // Update the record to set completed to an empty string
  $dgSetRow('workOrderOperations', rowData.rowKey, {
    completed: ''
  });
}

scrapNotes.onChange:
const opForNotes = $getGrid('notifications').filter((notification) => notification.workOrderOperation === rowData.rowKey)

console.log('opnotes: ', opForNotes)

$dgSetRow('notifications', opForNotes[0].rowKey, {
  done: false,
  notes: rowData.scrapNotes
});

